      <div *ngIf="isEnableNormalLogin" class="d-flex flex-column w-100 mt-3">
        <table style="width: 100%" class="position-relative">
          <tr class="text-center">
            <td style=""></td>
            <td style="">
              <div [@routerTransition]>
                <form novalidate autocomplete="off" #loginForm="ngForm" (ngSubmit)="login()">
                  <div class="form-group">
                    <div class="input-group">
                      <input type="text" class="form-control" name="userNameOrEmailAddress" [(ngModel)]="
                      authService.authenticateModel.userNameOrEmailAddress
                    " [placeholder]="'UserNameOrEmail' | ecTranslate" required maxlength="256"
                        #userNameOrEmailAddressModel="ngModel" #userNameOrEmailAddressEl />
                      <div class="input-group-append">
                        <div class="input-group-text">
                          <span class="fas fa-user"></span>
                        </div>
                      </div>
                    </div>
                    <abp-validation-summary [control]="userNameOrEmailAddressModel"
                      [controlEl]="userNameOrEmailAddressEl"></abp-validation-summary>
                  </div>
                  <div class="form-group">
                    <div class="input-group">
                      <input type="password" class="form-control" name="password"
                        [(ngModel)]="authService.authenticateModel.password" [placeholder]="'Password'" required
                        maxlength="32" #passwordModel="ngModel" #passwordEl />
                      <div class="input-group-append">
                        <div class="input-group-text">
                          <span class="fas fa-lock"></span>
                        </div>
                      </div>
                    </div>
                    <abp-validation-summary [control]="passwordModel" [controlEl]="passwordEl"></abp-validation-summary>
                  </div>
                  <div class="form-group row">
                    <div class="col-md d-flex justify-content-center">
                      <button type="submit" class="button w-100 button-login"
                        [disabled]="!loginForm.form.valid || submitting">
                        {{ "Login" }}
                      </button>
                    </div>
                  </div>
                </form>
              </div>
            </td>
            <td style="">
              <div class="mb-4 mt-4 btn-google" id="google-login-button"></div>
            </td>
          </tr>
        </table>
      </div>
      <p *ngIf="!tenancyName" class="login_btn--text">
        {{ "orLoginInformation" | ecTranslate }}
      </p>
